import React from "react";
import { siteData } from "./info/data";

function memberCard(mn,src) {
    return (
        <div class="col-md-4">
          <div class="card">
            <img class="card-img-top" alt="logo" src={src} />
            <div class="card-block">
              <h5 class="card-title">
                {siteData.homePage.clubInfo.clubmembers[mn].name}
              </h5>
              <p class="card-text">
                {siteData.homePage.clubInfo.clubmembers[mn].about}
              </p>
              <p>
                <a class="btn btn-primary" href="#">Contact</a>
              </p>
            </div>
          </div>
        </div>
    );
}
export default memberCard;
